import React from "react";
import { Routes,Route } from "react-router-dom";
import Home from './Component/Home'

const App=()=>{
  return(
    <>
    <Routes>
    <Route path='/welcome' element={<Home/>} />
    </Routes>
    </>
  )
}

export default App;
